import { Container, Paper, Table, TableCell, TableContainer, TableHead, TableRow } from '@mui/material'
import React, { Component, useEffect, useState } from 'react'
import axios from 'axios'

const [loading, setLoading] = useState(true)
const [data, setData]  = useState([])
useEffect(()=>{
    const fetchData = async () =>{
        setLoading(true);
        try{
            const {data: resposne} = await axios.get('localhost:8001');
            setData(resposne);
        }catch (erro){
            console.error(erro.message);

        }
        setLoading(false);
    }
    fetchData();

}, [])
export default class ListaPropostas extends Component {
  render() {
    return (
      <div>
        <TableContainer >
            <Table sx={{minWidth: 700}} arial-aria-label='simple table'>
                <TableHead>
                    <TableRow>
                        <TableCell>#</TableCell>
                        <TableCell>Data</TableCell>
                        <TableCell>Nome</TableCell>
                        <TableCell>Status</TableCell>

                    </TableRow>
                </TableHead>
            </Table>
        </TableContainer>
      </div>
    )
  }
}
